import gmb from './main-visual.jpg';
import Main from './link/main';
import { Link } from 'react-router-dom';
import './App.css';


class App extends Component {
 render(){
    return (
        <div className="demo-big-content">
<Navigation className="tombol">
<Link style={{ color: 'red' }} className="btn btn-primary" to="/keahian" >cek</Link>
</Navigation>

        <Main />

        <Grid className="demo-grid-ruler">
        <Cell col={4} className="kotak" ><img src={gmb} className="gambar" /></Cell>
        <Cell col={4} className="kotak" ><img src={gmb} className="gambar" /></Cell>
        <Cell col={4} className="kotak" ><img src={gmb} className="gambar" /></Cell>
        </Grid>

        <Grid className="demo-grid-ruler">
        <Cell col={4} className="kotak" ></Cell>
        <Cell col={4} className="kotak" ><img src={gmb} className="gambar" /></Cell>
        <Cell col={4} className="kotak" ><img src={gmb} className="gambar" /></Cell>
        </Grid>

        </div>

        );
    }
}

export default App;
